export default dogsReducer = (state = {}, action) => {

    switch(action.type){
      case "ADD_DOGS":
        return {...state, dogs: state.dogs}
      case "ADD_DOG":
        return {...state, dogs: state.dog}
      default:
        return state
    }

  }
